  onLoginClick,
  theme,
  isLoggedIn,
  isHomeActive,
  handleMobileClick,
  handleLogout,
  handleSearchSubmit
}) => {
  <header className="header"></header>;
  <Navigation
    onLoginClick={onLoginClick}
    theme={theme}
    isLoggedIn={isLoggedIn}
    isHomeActive={isHomeActive}
    handleMobileClick={handleMobileClick}
    handleLogout={handleLogout}
  />;
};
export default Header;

